export const setData = (data) => {
    return {
        type: 'setData',
        payload: data
    }
}

export const setCurrentPage = (data) => {
    return {
        type: 'setCurrentPage',
        payload: data
    }
}

export const setPostDetail = (id) => {
    return {
        type: 'setPostDetail',
        payload: id
    }
}
